export function GetLocation(): Promise<Position> {
	return new Promise((resolve, reject) => {
		if (navigator.geolocation) {
			navigator.geolocation.getCurrentPosition(
				(location) => resolve(location),
				(error) => reject(error)
			)
		}
	})
}
